// Navbar
import React from 'react';
import PropTypes from 'prop-types';
import './Navbar.css';

export default function Navbar(props) {
  const { active } = props;
  return (
    <nav  className={`navbar ${active ? 'active' : ''}`}>

      <a aria-current="true" href="#Home" class="active" >Home</a>
      <a aria-current="true" href="#Service" class="active" >Service</a>
      <a aria-current="true" href="#About" class="active">About</a>
      <a aria-current="true" href="#Contact" class="active">Contact Us</a>

    </nav>
  );
}
Navbar.propTypes = {
  active: PropTypes.bool,
}.isRequired;
